        <img src="/assets/images/Logo.png" alt="Logo Trouve un Artisan" className="logo-img" />
      </a>

      <button
        className={`hamburger ${menuOpen ? "open" : ""}`}
        onClick={() => setMenuOpen(!menuOpen)}
